import React from 'react';
import './App.css';

export default class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      response: "",
    }
  }

  componentDidMount() {
    fetch(`http://localhost:5000`, {
      method: 'GET'
    })
    .then(res => res.json())
    .then(resJSON => {
      this.setState({
        response: resJSON
      })
    })
  }

  HandleClick() {
    console.log("clicked");
  }

  render() {
    return (
      <div>
        <div className='landing'>
          <h1>reactdog</h1>
          <p>{this.state.response.message}</p>
        </div>
      </div>
    )
  }
}
